import React, { useState } from "react";

function Example(){
    const [contador,setContador] = useState(0);
    function sumaContador(){
        setContador(contador+1)
    }

    return(
        <div>
            <h1>{contador}</h1>
            <button onClick={sumaContador}>Sumar</button>
        </div>
    );
}

export default Example
